import { useGlobalContext } from "./context";
import Navbar from "./Navbar";
import allComponents from "./ComponentContainer";
function App() {
  const { isLoading } = useGlobalContext();
  if (isLoading) {
    return (
      <div>
        <h1 className="h1">Loading</h1>
      </div>
    );
  }
  return (
    <main>
      <Navbar />
    </main>
  );
}

export default App;
